import gallery from "../../assets/gallery";

const Gallery = () => {
  return (
    <div>
      {gallery.map((gallery) => (
        <li key={gallery.id}>
          <a href={gallery.url}> </a>
        </li>
      ))}
    </div>
  );
};

export default Gallery;
